#include "source.cpp"

#include <iostream>
#include <sstream>
using namespace std;

int main() {
	int test_count;
	cin >> test_count;
	HT<string> map;
	for (int i = 0; i < test_count; ++ i) {
		stringstream ss;
		ss << "text" << (1 + i);
		map.put(i * 10, ss.str());
	}
	cout << map.size() << endl;
	for (int i = 0; i < test_count; ++ i) {
		if (! map.containsKey(i * 10)) {
			cout << "bad" << endl;
		}
		else if (i % 100 == 50) {
			cout << map[i * 10] << endl;
		}
	}
	vector<int> keys = map.getKeys();
	for (int i = 0; i < keys.size(); ++ i) {
		map.remove(keys[i]);
	}
	cout << map.size() << endl;
}

#include<vector>
#include<iostream>
#include<string>
using namespace std;

class NotSuchKey{};
template <typename E>
class HT{
    class Tuple{
    public:
        int key;
        E value;
        Tuple(int key,E value) : key(key), value(value){}
    };
private:
    vector<Tuple> tuples;
    size_t indexOfkey(const int& key)const{
        for(size_t i = 0;i < tuples.size();i++){
            if(tuples[i].key == key) return i;
        }
        return -1;
    }
public:
    void put(int key, E value){
        size_t index = indexOfkey(key);
        if(index == -1) tuples.push_back(Tuple(key,value));
        else{
            tuples[index].value = value;
        }
    }
    size_t size(){
        return tuples.size();
    }
    bool containsKey(int key){
        return (indexOfkey(key) != -1);
    }
    E operator [] (const int& key){
        size_t index = indexOfkey(key);
        if(index == -1) throw NotSuchKey();
        return tuples[index].value;
    }
    void remove(const int& key){
        size_t index = indexOfkey(key);
        if(index == -1) throw NotSuchKey();
        tuples[index] = tuples[tuples.size()-1];
        tuples.pop_back();
    }
    vector<int> getKeys(){
        vector<int> ans;
        for(size_t i = 0;i < tuples.size();i++){
            ans.push_back(tuples[i].key);
        }
        return ans;
    }
};

